const Navbar = () => {
  return (
    <>
      <div className="container-fluid nav_bg">
        <div className="row">
          <div className="col-10 mx-auto">
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
              <div className="container-fluid">
                <Link to="/" className="navbar-brand">
                  Electric Vehicle
                </Link>
                <button
                  className="navbar-toggler"
                  type="button"
                  data-bs-toggle="collapse"
                  data-bs-target="#navbarSupportedContent"
                  aria-controls="navbarSupportedContent"
                  aria-expanded="false"
                  aria-label="Toggle navigation"
                >
                  <span className="navbar-toggler-icon"></span>
                </button>
                <div
                  className="collapse navbar-collapse"
                  id="navbarSupportedContent"
                >
                  <ul className="navbar-nav ml-auto mb-2 mb-lg-0">
                    <li className="nav-item">
                      <Link
                        activeClassName="menu_active"
                        exact
                        to="/"
                        className="nav-link active"
                        aria-current="page"
                      >
                        Home
                      </Link>
                    </li>
                    <li className="nav-item">
                      <Link activeClassName="menu_active" to="/about" className="nav-link">
                        About
                      </Link>
                    </li>
                    <li className="nav-item">
                      <Link activeClassName="menu_active" to="/benefits" className="nav-link">
                        Benefits
                      </Link>
                    </li>
                    <li className="nav-item">
                      <Link activeClassName="menu_active" to="/statistics" className="nav-link">
                        Statistics
                      </Link>
                    </li>
                    <li className="nav-item">
                      <Link activeClassName="menu_active" to="/resources" className="nav-link">
                        Resources
                      </Link>
                    </li>
                    <li className="nav-item">
                      <Link activeClassName="menu_active" to="/services" className="nav-link">
                        Services
                      </Link>
                    </li>
                    <li className="nav-item">
                      <Link activeClassName="menu_active" to="/contact" className="nav-link">
                        Contact
                      </Link>
                    </li>
                  </ul>
                </div>
              </div>
            </nav>
          </div>
        </div>
      </div>
    </>
  );
};
export default Navbar;
